const express = require ('express');

const app = express();


app.get('/users?name', (request, response) => {
    // const params = request.query;

    // console.log(params);

    return response.json({
        evento: 'Semama Omnistack 11.0',
        aluno: 'Diego Fernandes'
    });
});

app.listen(3333);
